import React from "react";
import "./MidSection.css";

export default function MIdSection() {
  return (
    <div className="mid-container">
      <div className="mid-section">
        <div className="profile-text">
          <span className="main-desc">Front-End React Developer</span>
          <br />
          <span>
            Hi, I'm Somesh Verma. A passionate React Developer based in India,
            Himachal.
          </span>
          <button>Git</button>
          <button>LinkedIn</button>
        </div>
        <img src="Assets/pprofile.png" className="profileImg" />
      </div>
    </div>
  );
}
